import React from "react";
import { AppBar, Toolbar } from "@mui/material";
import MenuBookIcon from "@mui/icons-material/MenuBook";

function Header() {
  return (
    <div>
      <AppBar>
        <Toolbar>
          <MenuBookIcon />
        </Toolbar>
      </AppBar>
    </div>
  );
}

export default Header;
